import React from 'react';
import { useNavigate } from 'react-router-dom';
import NavBar from '../../../components/NavBar/NavBar';
import styles from './Roster.module.scss';

const Roster = () => {
  const navigate = useNavigate();

  return (
    <div className={styles.pageContainer}>
      <NavBar />
      <main className={styles.mainContent}>
        <h1>Live Demo › Basic › Roster</h1>

        <div className={styles.progressBar}>
          <div className={styles.progress}></div>
        </div>

        <div className={styles.rosterSection}>
          <div className={styles.rosterHeader}>
            <h2>Class Roster</h2>
            <button className={styles.exportButton}>
              Export selected as CSV
            </button>
          </div>

          <div className={styles.rosterList}>
            <label className={styles.selectAll}>
              <input type="checkbox" />
              <span>Select All</span>
            </label>

            {Array(8).fill().map((_, index) => (
              <label key={index} className={styles.rosterItem}>
                <input type="checkbox" />
                <span>Anderson, Joseph — ajs5@miami.edu</span>
              </label>
            ))}
          </div>

          <div className={styles.dropZone}>
            <img src="/path-to-upload-icon" alt="" />
            <span>Select a file or drag and drop here</span>
            <span className={styles.supportText}>Format: csv size limits max 10MB</span>
          </div>
        </div>

        <div className={styles.navigation}>
          <button 
            className={styles.backButton}
            onClick={() => navigate('/basic-demo')}
          >
            ←
          </button>
          <button 
            className={styles.nextButton}
            onClick={() => navigate('/next-step')}
          >
            →
          </button>
        </div>
      </main>
    </div>
  );
};

export default Roster;
